import React from "react";
import {formatDate} from "../../formatDate";

const OrderShedule = (props) => {
    return (
        <>
            <div className="order_shedule_container">
                {props.aaaa.map(i => <div style={{display: "flex"}}>
                    <span>{i.froms}</span>
                    <span>{i.to}</span>
                    <span>{formatDate(new Date(i.date))}</span>
                    <span>{i.price} Ñ€.</span>
                </div>)}
            </div>
        </>
    )
}

export default OrderShedule;
